    function changecontent(names,content,image,color){
      function insert(element,id) {
            document
            .getElementById(id)
                .innerHTML = element;
            }
    for (i = 0; i < content.length; i++) {
        if (names[i] == 'NA'){
            document
            .getElementById(id)
                .innerHTML = element;
        }
    else {
        insert(names[i],content[i]);
        document.getElementById(img_id[i]).src = 'images/company-logo/' + image[count][i];
        document.getElementById(cmp_id[i]).style.backgroundColor = color[count][i];
         }
      }
    }
 
function next(event) {
      count += 1;
      if (count<cmp.length){
          changecontent(cmp[count],cmp_id,images,color);
      }
      else{
        count = 0;
        history.go(0);
        changecontent(cmp[count],cmp_id,images,color);
          }
    }

 function previous(event) {
      count -= 1;
      if (count>0){
          changecontent(cmp[count],cmp_id,images,color);
      }
      else{
        count = 0;
        //history.go(0);
        changecontent(cmp[count],cmp_id,images,color);
          }
    }

